sys_variable_value.value:
(function execute(inputs, outputs) {
   //Execute a scheduled script jobs
   //This script doesnt return any output variables.
   var rec = new GlideRecord('scheduled_import_set');
   var jobName = inputs.jobname;
   rec.get('name', jobName);
   if (typeof SncTriggerSynchronizer != 'undefined') {
      SncTriggerSynchronizer.executeNow(rec);
   }
   else {
      Packages.com.snc.automation.TriggerSynchronizer.executeNow(rec);
   }
})(inputs, outputs);

